import React, { useState } from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';



const AddUser = () => {
    const [state, setState] = useState({
        country:"",
        city:'',
        population:'',
    })
    const {country,city,population}= state;
  return (
    <div>
        Add city
        <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >

      <TextField id="standard-basic" label="country" variant="standard" value={country} type="text"/>
      <TextField id="standard-basic" label="city" variant="standard" value={city} type="text"/>
      <TextField id="standard-basic" label="population" variant="standard" value={population} type="number"/>
      <Button variant='contained' onSubmit={()=>history.push('/add-city')} type="submit">submit</Button>
    </Box>
    </div>
  )
}

export default AddUser
